  "info": {
    "_postman_id": "7147946-df989e17-561e-4136-b933-174d10e92841",
    "name": "Aquanow-API V1.0",
    "description": "Welcome to the Aquanow API documentation. The intent of this documentation was to provide user-friendly information to our clients.\n\nAquanow provides best-in-class execution platform and institutional-quality trading solutions via a single point of access to aggregate liquidity across cryptocurrency marketplaces and exchanges. The repository contains the information to our end users to access our streaming data, pre-trade analytics and execution services.\n\n# Creating an API Key\n\nThe API was built using Postman and thus can be downloaded and tested with the **Postman App**.\n\nSome requests will require an authentication API key. \n\nFollow these steps to create your API Key:\n\n1. Login to your Aquanow account. \n2. Click on your username in the top right corner and click on the API key button\n3. ![](https://i.imgur.com/85hLPWF.png)\n4. Create your API Key\n**Note:** Your secret key will only show once! Copy it down and store it somewhere safe.\n\nOnce you have attained your API key, use them as authentication in your headers:\n-\tx-api-key : KeyID\n-\tx-api-secre : Secret\n\n# Versions\n\nThis is Version 1.0 of Aquanow API Documentation. For different versions, click on the dropdown below:\n\n<details>\n\t\t<p>\n\t\t</p>\n\t\t<p>\n\t\t\t<a href=\"https://documenter.getpostman.com/view/7147946/S1EJW1Jb#intro\">\n\t\t\t\tVersion 1.0: Compatible with the current version of Aquanow\n\t\t\t</a>\n\t\t</p>\n</details>\n\n# Rate Limits\n---\n\nTo ensure safety against throttling, we have instated rate limits for users. Currently these limits are:\n\n**Rate: 1000 Requests per second**\n\n>The rate at which tokens are added to the Token Bucket. This value indicates the average number of requests per second over an extended period of time.\n\t\n**Burst: 2000 Requests**\n\n>The capacity of the Token Bucket\n\t\n**Quote: 5000 Requests per day**\n\n>The total number of requests you can perform in a given time period. This limit resets at UTC 00:00:00 every day\n\n# Examples\n\n![Example](https://i.imgur.com/HPijQhJ.gif)\n\n\nThere are **multiple** examples for requests each endpoints, make sure to click on the examples to view the different examples including those that thrown errors. \n\n\n## Example Requests in multiple languages\n![Example](https://i.imgur.com/GhhS14j.gif)\n\nYou can view the request in multiple languages. Currently the languages supported are:\n\n\t- cURL\n\t- Ruby\n\t- Python Requests\n\t- Node\n\t- PHP\n\t- Go\n\n",
