        {
          "_postman_id": "7147946-f6039ea4-fca9-4b4a-9570-7bcdf2942ac4",
          "name": "Websockets",
          "description": "# Aquanow Websocket Information\n* Aquanow provides real-time aggregated market data feed through websocket to our end users. \n* Data can be accessed either in single or combined streams by sending Aquanow subscription messages.\n* The data requests share the same base endpoint: wss://api.aquanow.io:8081\n* The following are the detail information regarding the websocket api and subscription messages.\n\n\n# Subscribe\n\nIn order to receive data feed, user sends a *subscribe* message to the server, after Succesful websocket connection. User must also indicate in subscription request, the channel user wish to subscribe on. When a *subscribe* message is received with a pair and channel, the server will respond with a **subscription** message that lists all channels you are subscribed to. \n\nAquanow currently have two channels available for market data feed:\n\n### orderbook : Grabs the entire orderbook for the pair specified.\n\n```javascript\n//Example of subscribe request for orderbook\n{\n  \"type\": \"subscribe\",      // Message Type\n  \"channel\" : 'orderBook',   // Subscription Channel\n  \"pair\" : 'BTC-USD',         // Key-Value pairs, depends on the socket.\n}\n```\n\n### ticker : Best bid-offer pairs for Aquanow\n\n```javascript\n//Example of subscribe request for ticker\n{\n  \"type\": \"subscribe\",      // Message Type\n  \"channel\" : 'ticker',   // Subscription Channel\n  \"pair\" : 'BTC-USD',         // Key-Value pairs, depends on the socket.\n}\n```\n\nYou can unsubscribe to a channel at any time:\n\n```javascript\n//Example of subscribe request\n{\n  \"type\": \"unsubscribe\",      // Message Type\n  \"channel\": 'orderBook',     // Subscription Channel\n  \"pair\": 'BTC-USD'           // Symbol\n}\n```\n\n### If you are unfamiliar with websockets, please click the following link to read up before using!\n\n[MDN Web Docs](https://developer.mozilla.org/en-US/docs/Web/API/WebSockets_API)",
          "item": [
            {
              "_postman_id": "7147946-c1795d0c-823d-4af3-bf5c-bc126576accc",
              "name": "Websocket Example",
              "description": "Right below is an html code snippet you can copy and paste to try out our websocket. \n\n```html\n<!DOCTYPE html>\n<meta charset=\"utf-8\" />\n<title>Aquanow WebSocket Test</title>\n<script language=\"javascript\" type=\"text/javascript\">\n  //dev environment\n  var wsUri = \"wss://market-dev.aquanow.io:8081/\";\n  var output;\n  /**\n   * Initializes the websockt and grabs the output div to display messages\n   **/\n  function init() {\n    output = document.getElementById(\"output\");\n    testWebSocket();\n  }\n\n  /**\n   * Line 19-67:\n   * testWebsocket: different fuctions depneding on the response.\n   **/\n  function testWebSocket() {\n    websocket = new WebSocket(wsUri);\n    websocket.onopen = function(evt) {\n      onOpen(evt);\n    };\n    websocket.onclose = function(evt) {\n      onClose(evt);\n    };\n    websocket.onmessage = function(evt) {\n      onMessage(evt);\n    };\n    websocket.onerror = function(evt) {\n      onError(evt);\n    };\n  }\n\n  function onOpen(evt) {\n    writeToScreen(\"CONNECTED\");\n\n    doSend(\"WebSocket rocks\");\n  }\n\n  function onClose(evt) {\n    writeToScreen(\"DISCONNECTED\");\n  }\n\n  function onMessage(data) {\n    writeToScreen(\n      '<span style=\"color: blue;\">RESPONSE: ' + data.data + \"</span>\"\n    );\n    console.log(data.data);\n    let jData = JSON.parse(data);\n\n    if (jData.dataType == \"status\") {\n      console.log(jData.lastUpdated, jData);\n    }\n\n    if (jData.dataType === \"aggBBO\") {\n      console.log(jData.lastUpdated, jData);\n    }\n\n    if (jData.dataType === \"aggOB\") {\n      console.log(jData.lastUpdated, jData.bids.slice(0, 50));\n    }\n  }\n\n  function onError(evt) {\n    writeToScreen('<span style=\"color: red;\">ERROR:</span> ' + evt.data);\n  }\n\n  /**\n   * doSend: Where you can actually set websocket options. See the documentation for details.\n   **/\n\n  function doSend(message) {\n    writeToScreen(\"SENT: \" + message);\n    websocket.send(\n      JSON.stringify({\n        type: \"subscribe\",\n        channel: \"ticker\",\n        pair: \"BTC-USD\",\n        precision: 4\n      })\n    );\n    // To unsubscribe uncomment the code below\n    // websocket.send(JSON.stringify({ \"type\":\"unsubscribe\", \"channel\":\"orderBook\", \"pair\": \"BTC-USD\", \"precision\": 2}));\n  }\n\n  function writeToScreen(message) {\n    var pre = document.createElement(\"p\");\n    pre.style.wordWrap = \"break-word\";\n    pre.innerHTML = message;\n    output.appendChild(pre);\n  }\n\n  window.addEventListener(\"load\", init, false);\n</script>\n\n<h2>Aquanow WebSocket Test</h2>\n\n<div id=\"output\"></div>\n\n```\n\n## Steps \n\n1. Copy and Paste the code into a brand new **index.html** file\n\n2. Open the file on browser, and wait for the websocket to connect. \n\n3. See incoming information. \n\n## Customization\n\t\nYou can customize the websocket response by altering the **doSend()** function. \n\t\n- **type**: Type of connection. **subscribe** to connect to our network or switch to **unsubscribe** to cancel.\n\n- **channel**: Currently we have two channels: **orderBook** and **ticker**. Look at our [Subscription Message parameters](https://documenter.getpostman.com/view/7147946/S1EJW1Jb#390da862-7745-4a87-a7f2-d3fd3f35c934) for more details. ",
              "item": [],
              "_postman_isSubFolder": true
            },
